import { Chart } from "react-google-charts";
const Donut = () => {
  const pieOptions = {
    pieHole: 0.7,
    slices: [
      {
        color: "F16A21",
      },
      {
        color: "#e9a227",
      },
    ],
    dataLabels: {
      enabled: false,
    },
    legend: {
      position: "bottom",
      alignment: "center",
    },
    tooltip: {
      showColorCode: true,
    },
    // chartArea: {
    //     left: 0,
    //     top: 0,
    //     width: '100%',
    //     height: '70%',
    // },
  };
  return (
    <>
      <Chart
        chartType="PieChart"
        data={[
          ["Item", "Numbers"],
          ["d 1", 5000],
          ["Item 2", 20000],
        ]}
        options={pieOptions}
        graph_id="PieChart"
        width={"100%"}
        height={"100%"}
        legend_toggle
      />
    </>
  );
};

export default Donut;
